import React from 'react';
import {Container,Content,Card} from './style'
import mahsulotlar  from '../../../mock/mahsulotlar'
const Mahsulotlar1 = () => {
  return(
      <Container>
             <Content>
                   {
                       mahsulotlar.map((value)=>{
                           return(
                               <Card key={value.id}>
                                 <h1>{}</h1>
                               </Card>
                           )
                       })
                   }
             </Content>
      </Container>
  )
};

export default Mahsulotlar1;
